commit.message:
dafny: Fix indentation of `case` based on @MikaelMayer's rules

The rendering is now as follows:

```dafny
method M(b: bool) {
  match b
  case true => print "true";
  case false => print "false";
}

method N(b: bool) {
  match b {
    case true => print "true";
    case false => print "false";
  }
}
```
